    'Access-Control-Allow-Origin' : '*',
    headers: {"Token": "3f59f4bdbb99d5a20973ff88908846f888c992953fc82d3c5c67c98483269265"}

});

export const faqAPI =  {
    getFaq_Group: ()=>{
        return instance('faq_category/')},
